import { useEffect, useState } from 'react';
import './App.css';

function App() {
  // definizioni degli stati
  const [commessa, setCommessa] = useState([])

  const [compito, setCompito] = useState("")

  useEffect(() => {
    fetch("http://localhost:8080/commessa").then(r => r.json()).then(body => {
      setCommessa(body)
    })
  },[])

  useEffect(() =>{
    console.log(compito)
  },[compito])

  const commessaJSX = commessa.map(commessa => (<li key={commessa.id}>{commessa.titolo}<li>{commessa.descrizione}</li></li>))
  return (
    <div className="App">
      <header className="App-header">

        <h1>{compito}</h1>
        <input type="text" value={compito} onChange={(e) => setCompito(e.target.value)}></input>

        commessa
        <ul>
        {commessaJSX}
        </ul>
      </header>
    </div>
  );
}

export default App;
